package dasar;

public class KelasElseIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	Integer umur = 3;
	if (umur <= 5) {
		System.out.println("PAUD");
		
	} else if (umur >= 6 && umur <= 7) { //umur 6 - 7 taun
		System.out.println("TK");
	
	}else {
		System.out.println("Sekolah");
	}
	
	}

}
